import React from "react";

const Details = ({ data }) => {
  const Link = data[1];
  const tempArea = data[2];
  const tempPerimeter = data[3];
  const area = tempArea[0].toFixed(4);
  const perimeter = tempPerimeter[0].toFixed(4);

  return (
    <div className="bbox">
      <h4>API</h4>
      <a href={Link}>{Link}</a>
      <br></br>
      <h3>Details</h3>
      <h4>Area: {area} hectare</h4>
      <h4>Perimeter: {perimeter} Km</h4>
    </div>
  );
};

export default Details;
